全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)ゴミ袋スタンド<br>
<br>
スーパーのレジ袋と４５Lのゴミ袋が使える！<br>
<br>
・落ち葉集めなどの庭掃除に<br>
・キャンプ・バーベキューなどのアウトドアに<br>
・各種スポーツ、お祭り、花火大会などのイベントに<br>
・一般家庭、業務用ゴミ袋スタンドとして<br>
<br>
○持ち運びに便利な簡単組立<br>
○スーパーのレジ袋なら２ヶセットできるので分別できます<br>
○４５Lのゴミ袋は開口部が３０cmと大きいので入れ易い<br>
○使用中の移動も取っ手が付いてるのでラクラクです<br>
○自治体指定のゴミ袋（４５L）を使用すれば、そのまま<br>
　回収ゴミとして処理できます<br>
<br>
完成品サイズ：縦31×横39×高さ59cm<br>
重量：1.5kg<br><img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
