日本製<br>
<br>
どんな庭にも合うシンプルなデザイン<br>
鉄パイプは頑丈で耐久性のある日本製です<br>
つる植物をからませてお庭の演出を・・・<br>
<br>
材質：鉄（メラミン焼付塗装仕上げ）<br>
色：モスグリーン<br>
本体フレーム：外径19.1mm（肉厚0.1mm）<br>
連結バー：8mm鉄棒<br>
